import React, { useState } from 'react';

const Events = () => {
    const [events, setEvents] = useState([]);
    const [eventData, setEventData] = useState({
        name: '',
        date: '',
        location: '',
        image: '',
        description: '',
    });

    // Simulating admin login state
    const [isAdmin, setIsAdmin] = useState(false); // Change this to true to simulate an admin login

    const handleChange = (e) => {
        const { name, value } = e.target;
        setEventData({
            ...eventData,
            [name]: value,
        });
    };

    const handleSubmit = (e) => {
        e.preventDefault();
        setEvents([...events, eventData]);
        setEventData({
            name: '',
            date: '',
            location: '',
            image: '',
            description: '',
        });
    };

    return (
        <div>
            <h2>Add Upcoming Events</h2>
            {/* Check if the user is an admin */}
            {isAdmin ? (
                <form onSubmit={handleSubmit}>
                    <div>
                        <label>Event Name:</label>
                        <input
                            type="text"
                            name="name"
                            value={eventData.name}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label>Date:</label>
                        <input
                            type="date"
                            name="date"
                            value={eventData.date}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label>Location:</label>
                        <input
                            type="text"
                            name="location"
                            value={eventData.location}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label>Image URL:</label>
                        <input
                            type="text"
                            name="image"
                            value={eventData.image}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <div>
                        <label>Description:</label>
                        <textarea
                            name="description"
                            value={eventData.description}
                            onChange={handleChange}
                            required
                        />
                    </div>
                    <button type="submit">Add Event</button>
                </form>
            ) : (
                <p>You must be an admin to add events.</p>
            )}

            <h2>Upcoming Events</h2>
            <div className="event-list">
                {events.map((event, index) => (
                    <div key={index} className="event">
                        <h3>{event.name}</h3>
                        <p><strong>Date:</strong> {new Date(event.date).toLocaleDateString()}</p>
                        <p><strong>Location:</strong> {event.location}</p>
                        <img src={event.image} alt={event.name} style={{ width: '300px', height: 'auto' }} />
                        <p><strong>Description:</strong> {event.description}</p>
                    </div>
                ))}
            </div>

            <style jsx>{`
                .event-list {
                    margin-top: 20px;
                }
                .event {
                    border: 1px solid #ccc;
                    padding: 10px;
                    margin: 10px 0;
                }
            `}</style>
        </div>
    );
};

export default Events;
